def excel_date_to_str(serial):
    try:
        base_date = datetime(1899, 12, 30)
        delta = timedelta(days=int(serial))
        return (base_date + delta).strftime("%d/%m/%Y")
    except:
        return serial

output_file = "modelo_importacao.csv"

with open(output_file, 'w', newline='', encoding='utf-8') as f:
    writer = csv.writer(f, delimiter=';')
    # Write Header
    writer.writerow(['DTTRANSACAO', 'DESDOBRAMENTO', 'VLRTRANSACAO', 'AUTORIZACAO', 'NSU'])
    
    # Process rows
    for line in raw_data.split('\n'):
        if not line.strip(): continue
        parts = line.split('\t')
        if len(parts) < 25: continue
        
        # Mapping based on user's raw data structure
        # Index 1: data original da venda -> DTTRANSACAO
        # Index 23: DESDOBRAMENTO -> DESDOBRAMENTO
        # Index 7: valor líquido da parcela -> VLRTRANSACAO
        # Index 13: número da autorização -> AUTORIZACAO
        # Index 10: NSU/CV -> NSU
        
        dt_transacao = excel_date_to_str(parts[1])
        desdobramento = parts[23]
        vlr_transacao = parts[7] # Already has comma, good
        autorizacao = parts[13]
        nsu = parts[10]
        
        writer.writerow([dt_transacao, desdobramento, vlr_transacao, autorizacao, nsu])

